DROP DATABASE DemoCompanyAddressBook
CREATE DATABASE DemoCompanyAddressBook

CREATE TABLE [DemoCompanyAddressBook].[dbo].[Company](
  [Id] UniqueIdentifier NOT NULL CONSTRAINT pk_Company_Id PRIMARY KEY,
  [Name] VARCHAR(250) NULL,
  [RegistrationNumber] VARCHAR(10) NULL,
  [Telephone] VARCHAR(12) NULL,
  [Email] VARCHAR(250) NULL,
  [WebSite] VARCHAR(250) NULL,
  [PostCode] VARCHAR(8) NULL,
  [AddressLine1] VARCHAR(250) NULL,
  [AddressLine2] VARCHAR(250) NULL,
  [Town] VARCHAR(250) NULL,
  [County] VARCHAR(250) NULL
)


CREATE TABLE [DemoCompanyAddressBook].[dbo].[Contact](
	[Id] UniqueIdentifier NOT NULL CONSTRAINT pk_Contact_Id PRIMARY KEY,
	[CompanyId] UniqueIdentifier NOT NULL CONSTRAINT fk_Contact_CompanyId FOREIGN KEY REFERENCES Company(Id),
	[Title] VARCHAR(10) NOT NULL,
	[FirstName] VARCHAR(100) NOT NULL,
	[LastName] VARCHAR(100) NOT NULL,
	[Email] VARCHAR(250) NULL,
	[PhoneNumber] VARCHAR(12) NULL,
	[CompanyPosition] VARCHAR(250) NULL
)








